  header: {
    config: {
      xs: {
        position: "relative",
        height: 56
      },
      md: {
        position: "relative",
        height: 64
      }
    }
  },
  leftEdgeSidebar: {
    config: {
      xs: {
        variant: "temporary",
        width: 256
      },
      sm: {
        variant: "persistent",
        width: 256,
